import React from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css'; // Custom styles for the landing page

const LandingPage = () => {
    const navigate = useNavigate();

    const goToLogin = () => {
        navigate('/login');
    };

    const goToAboutUs = () => {
        navigate('/aboutus');
    };

    const goToContact = () => {
        navigate('/contact');
    };

    return (
        <div className="landing-container">
            {/* First Section: Image and Login Card side by side */}
            <div className="landing-main-content">
                <img src="/images/supprt_ticketng-System.png" alt="Customer Support" className="landing-image" />
                <div className="landing-content">
                    <div className="text-section">
                        <h1 className="main-heading">Welcome to Teleassist</h1>
                        <p>Your trusted platform for all support needs</p>
                        <div className="button-section">
                            <button onClick={goToLogin} className="landing-button">Login</button>
                            <button onClick={goToAboutUs} className="landing-button">About Us</button>
                            <button onClick={goToContact} className="landing-button">Contact Us</button>
                        </div>
                    </div>
                </div>
            </div>

            {/* Second Section: About Us below */}
            <div className="about-us-section">
                <div className="about-us">
                    <h1>About Us</h1>
                    <p>Welcome to TelecomCo. We are committed to providing exceptional telecom services...</p>
                    <h2>Our Mission</h2>
                    <p>To connect people and businesses globally...</p>
                    <h2>Our Team</h2>
                    <p>Meet the innovative team behind our success...</p>
                    <h2>Contact Us</h2>
                    <p>For any inquiries, feel free to reach out to us at contact@telecomco.com</p>
                </div>
            </div>
        </div>
    );
};

export default LandingPage;
